import React, { Component } from 'react'

class ClassClick extends Component {
    clickHandler(){
        console.log("Class Button Clicked !!")
    }
    render() {
        return (
            <div>
                <button onClick={this.clickHandler}>Click from Class</button>
            </div>
        )
    }
}

export default ClassClick
